"""
This is an implementation of famous fizzbuzz problem
We do this just for demonstration
"""


def fizzbuzz(i):
    if i % 15 == 0:
        print("fizzbuzz")
    elif i % 5 == 0:
        print("buzz")
    elif i % 3 == 0:
        print("fizz")
    else:
        print(str(i))

for i in range(27):
    fizzbuzz(i)
